import React, { useEffect } from "react";
import { Link } from "react-router-dom";

const Home = () => {
  useEffect(() => {
    const handleMouseMove = (e) => {
      const parallax = document.querySelector('.home-container');
      const speed = 15;
      const x = (window.innerWidth - e.pageX * speed) / 100;
      const y = (window.innerHeight - e.pageY * speed) / 100;
      parallax.style.backgroundPosition = `${x}px ${y}px`;
    };

    document.addEventListener('mousemove', handleMouseMove);
    return () => document.removeEventListener('mousemove', handleMouseMove);
  }, []);

  return (
    <div className="home-container">
      <div className="welcome-box">
        <h1 className="title animate-pop-in">Welcome to the Consultation App</h1>
        <p className="subtitle animate-pop-in">
          Connect with experts for your academic and professional growth
        </p>
        <div className="divider"></div>
        
        <div className="button-group">
          <Link to="/login">
            <button className="btn-gradient">
              Get Started
              <svg xmlns="http://www.w3.org/2000/svg" className="icon" viewBox="0 0 24 24">
                <path d="M13.025 1l-2.847 2.828 6.176 6.176h-16.354v3.992h16.354l-6.176 6.176 2.847 2.828 10.975-11z"/>
              </svg>
            </button>
          </Link>
          <div className="auth-links">
            <Link to="/login" className="auth-link">Existing User? Login</Link>
            <Link to="/signup" className="auth-link">New User? Sign Up</Link>
          </div>
        </div>
      </div>

      <style>
        {`
          html, body {
            margin: 0;
            padding: 0;
            height: 100%;
            overflow: hidden;
            font-family: 'Segoe UI', system-ui, sans-serif;
          }

          .home-container {
            width: 100vw;
            height: 100vh;
            display: flex;
            align-items: center;
            justify-content: center;
            background: linear-gradient(45deg, rgba(18, 24, 38, 0.95), rgba(32, 39, 55, 0.9)),
                        url('https://images.pexels.com/photos/2049422/pexels-photo-2049422.jpeg') 
                        center center/cover;
            position: fixed;
            top: 0;
            left: 0;
            transition: background-position 0.3s ease-out;
          }

          .welcome-box {
            background: rgba(255, 255, 255, 0.08);
            backdrop-filter: blur(12px) saturate(180%);
            border-radius: 20px;
            padding: 3rem 4rem;
            position: relative;
            border: 1px solid rgba(255, 255, 255, 0.1);
            box-shadow: 0 8px 32px rgba(0, 0, 0, 0.3);
            transform: translateY(0);
            transition: transform 0.3s ease;
          }

          .welcome-box:hover {
            transform: translateY(-5px);
          }

          .title {
            font-size: 2.8rem;
            color: #fff;
            font-weight: 700;
            margin: 0 0 1rem 0;
            letter-spacing: -0.5px;
            background: linear-gradient(45deg, #fff, #e6f1ff);
            -webkit-background-clip: text;
            -webkit-text-fill-color: transparent;
            opacity: 0;
            animation: fadeInUp 0.8s ease-out forwards;
          }

          .subtitle {
            font-size: 1.25rem;
            color: rgba(255, 255, 255, 0.85);
            margin: 0 0 2rem 0;
            font-weight: 400;
            line-height: 1.6;
            max-width: 600px;
            opacity: 0;
            animation: fadeInUp 0.8s ease-out 0.2s forwards;
          }

          .divider {
            height: 1px;
            background: linear-gradient(90deg, transparent, rgba(255, 255, 255, 0.2), transparent);
            margin: 2rem auto;
            width: 80%;
          }

          .button-group {
            display: flex;
            flex-direction: column;
            gap: 1.5rem;
            align-items: center;
          }

          .btn-gradient {
            background: linear-gradient(45deg, #6366f1, #8b5cf6);
            color: white;
            border: none;
            padding: 1rem 2.5rem;
            font-size: 1.1rem;
            border-radius: 50px;
            cursor: pointer;
            display: flex;
            align-items: center;
            gap: 0.75rem;
            transition: all 0.3s cubic-bezier(0.4, 0, 0.2, 1);
            box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
          }

          .btn-gradient:hover {
            transform: translateY(-2px);
            box-shadow: 0 8px 15px rgba(99, 102, 241, 0.3);
            gap: 1.25rem;
          }

          .btn-gradient .icon {
            width: 1.25rem;
            height: 1.25rem;
            fill: currentColor;
            transition: transform 0.3s ease;
          }

          .btn-gradient:hover .icon {
            transform: translateX(3px);
          }

          .auth-links {
            display: flex;
            gap: 1.5rem;
            margin-top: 1rem;
          }

          .auth-link {
            color: rgba(255, 255, 255, 0.8);
            text-decoration: none;
            font-size: 0.95rem;
            position: relative;
            padding: 0.25rem 0;
            transition: color 0.3s ease;
          }

          .auth-link::after {
            content: '';
            position: absolute;
            bottom: 0;
            left: 0;
            width: 0;
            height: 1px;
            background: currentColor;
            transition: width 0.3s ease;
          }

          .auth-link:hover {
            color: white;
          }

          .auth-link:hover::after {
            width: 100%;
          }

          @keyframes fadeInUp {
            from {
              opacity: 0;
              transform: translateY(20px);
            }
            to {
              opacity: 1;
              transform: translateY(0);
            }
          }

          @media (max-width: 768px) {
            .welcome-box {
              padding: 2rem;
              margin: 1rem;
              width: 90%;
            }

            .title {
              font-size: 2rem;
            }

            .subtitle {
              font-size: 1rem;
            }

            .btn-gradient {
              padding: 0.75rem 1.5rem;
              font-size: 1rem;
            }

            .auth-links {
              flex-direction: column;
              align-items: center;
              gap: 1rem;
            }
          }

          @media (max-width: 480px) {
            .title {
              font-size: 1.75rem;
            }
            
            .btn-gradient {
              width: 100%;
              justify-content: center;
            }
          }
        `}
      </style>
    </div>
  );
};

export default Home;
